import { useState } from "react";
import Expense from "./components/Expenses/Expenses.js";
import NewExpense from "./components/NewExpense/NewExpense.js";


const INITIAL_STATES = [
    {
      id: 'e1',
      title: 'JEAN-GEORGES PHILADELPHIA',
      amount: 4.5,
      date: new Date(2023, 7, 14),
    },
    { id: 'e2', 
    title: 'Del Frisco\'s Double Eagle Steakhouse', 
    amount: 4, 
    date: new Date(2022, 2, 12)
     },
    {
      id: 'e3',
      title: 'Sang Kee Noodle House',
      amount: 5,
      date: new Date(2021, 2, 28),
    },
    {
      id: 'e4',
      title: 'McDonald\'s, 3935 Walnut St',
      amount: 3,
      date: new Date(2020, 5, 12),
    },
];


function App() {

    const [expenses, setExpenses] = useState(INITIAL_STATES);

    const addExpenseHandler = expense => {
        setExpenses((prevExpenses) => {
            return [expense, ...prevExpenses];
        });
    };


    return (
        <div>
            <NewExpense onAddExpense = {addExpenseHandler}/>
            <Expense items={expenses}/>
        </div>

    );
}

export default App;
